import React from 'react';
import classes from './shoeMenuData.module.css';

function CasualsData(){
    return(
        <ul className={classes.shoeList}>
            <li>Sneakers</li>
            <li>Loafers</li>
        </ul>
    );
}

export {CasualsData};
